  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is the finished product of
  the NPS Vegetation Mapping Project at Fire Island National Seashore. This dataset
  depicts the association-level vegetation map for the entire length of Fire Island
  and the William Floyd Estate. The park islands in the Great South Bay can be found
  in a separate file included on the disk. These vegetation polygons were interpreted
  and delineated from 1:1200-scale true-color aerial photographs taken in April 1997.
  They are attributed with NVCS associations as well as height, pattern, and density
  information.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
